import Login from './components/Login.jsx';
import {BrowserRouter,Routes, Route} from 'react-router-dom'

function App() {
  return (
    <>
      <Routes>
        <Route path="/" exact element={Login}></Route>
      </Routes>
    </>
  );
}

export default App;
